AccountLinkServiceOwnerShipType:
  type: string
  nullable: true
  enum:
  - OWNER
  - NON_OWNER
  - UNKNOWN
  title: AccountLinkServiceOwnerShipType
  description: |
    <div lang="ja">AccountLinkServiceOwnerShipTypeは、リンク先のアカウントが同一企業内のアカウントかどうかを表します。</div>
    <div lang="en">AccountLinkServiceOwnerShipType describes whether the linked account is an account within the same company.</div>
    <dl class=term>
      <dt class="term__item">OWNER</dt>
      <dd class="term__desc"><span lang="ja">リンク先のアカウントは同一企業内のアカウントです。</span><span lang="en">The linked account is an account within the same company.</span></dd>
      <dt class="term__item">NON_OWNER</dt>
      <dd class="term__desc"><span lang="ja">リンク先のアカウントは他企業のアカウントです。</span><span lang="en">The linked account is an account of another company.</span></dd>
      <dt class="term__item">UNKNOWN</dt>
      <dd class="term__desc"><span lang="ja">未知の値です。</span><span lang="en">Unknown value.</span></dd>
    </dl>
